import React, { Component } from 'react'
import Navibar from "../Coponent/Navibar";

import { Link } from 'react-router-dom';

export default class Property extends Component {
    constructor(props) {
        super(props)
        this.state = {
            name: "",
            status: "",
            price: ""
        }
        this.onCheckChange = this.onCheckChange.bind(this);
        // this.handleChange = this.handleChange.bind(this);

    }
    getData(){
        console.log(this.props.user.sid)
        var url="http://127.0.0.1:8081/v2/room/supplier?sid="
        url+=this.props.user.sid
        console.log(url)
        fetch(url,{
            method:'GET'
        }).then(res => res.json()).then(
            data=>{
                this.setState({name: data,status : data,price : data})
            }
        )
    }



    render() {
        console.log(this.props.user.sid)
        return (
            <div className = "property">
                <Navibar loggedinstatus={this.props.loggedinstatus} />  
                <div className="property-container">
                    <button className="proper_button" onClick={()=> {this.getData()}}>Manage your property</button>
                    <br />
                    <section className="s_div">

                    </section>
                </div>
            </div>      
        )
    }
}
